import "./models/token"

const Pessoa = new Pessoa("devSantos16")

async function returnUser() {
    
    console.log(Pessoa.URL())
    try {
        const response = await fetch(Pessoa.URL());
        const data = await response.json();
        console.log(data);
        
    }
    catch (error) {
        console.log(error.message);
    }
}

export default returnUser
